import React from 'react';
import './App.css';
import Fragment from 'render-fragment';




class App extends React.Component {


  render() {
    return (
      <Fragment>

      <body> 

          <section id="sideMenu">
            <nav>

            <a href="#" class="active" class="far fa-calendar-alt"> Widget1 </a>
            <a href="#"> Widget2 </a>
            <a href="#"> Widget3 </a>
            <a href="#"> Widget4 </a>

            </nav>


          </section>
      </body>
    </Fragment>
    );
  }

}


export default App;
